(65290, 50539, 0, 1, '玻璃的殼', '主1:	翻轉沙漏流逝 漩渦般思緒 穿針引線的流\n	1-(xxxxxxxxxx   e04 我忘記了...\n\n	視線漸漸扭曲 鏡面折射模糊另一個我\n	2-(但包覆在外是一層厚厚的沙\n\n副1:	我悄悄捲曲在這 看似能依靠的殼\n	還很滿足的以為它 能保護我\n	我靜靜就躲在這 這是個玻璃的殼\n	還很滿足的以為它 能保護我\n	當危險輕輕伸出指頭 觸碰到的時候\n	它卻這樣硬生生的就碎了 就碎了\n\n間奏:	Like a without pondering Crystal waiting for digging\n	Outside is a thick layer of sand\n\n主2:	翻轉沙漏流逝 漩渦般思緒 穿針引線的流\n	像是個未經琢磨水晶 等待著誰挖掘著\n	視線漸漸扭曲 鏡面折射模糊的另外個我\n	但包覆在外是一層厚厚的沙模糊了我眼睛 \n	忽明忽滅\n\n副歌2:一次又一次 考驗著我 蛻變翱翔我破蛹為蛾\n\n	現在的我 緩緩爬出那兒 換我化身為殼\n	無懈可擊的 保護著那些愛我愛的人\n	不讓他們 受到任何傷痛 \n	我將阻擋著一切 這一切 \n	將希望寄託在他們的手', '2013-07-05 00:00:00', 2013, 19, 1, 9, '主1:	翻轉沙漏流逝 漩渦般思緒 穿針引線的流\n	1-(xxxxxxxxxx   e04 我忘記了...\n\n	視線漸漸扭曲 鏡面折射模糊另一個我\n	2-(但包覆在外是一層厚厚的沙\n\n副1:	我悄悄捲曲在這 看似能依靠的殼\n	還很滿足的以為它 能保護我\n	我靜靜就躲在這 這是個玻璃的殼\n	還很滿足的以為它 能保護我\n	當危險輕輕伸出指頭 觸碰到的時候\n	它卻這樣硬生生的就碎了 就碎了\n\n間奏:	Like a without pondering Crystal waiting for digging\n	Outside is a thick layer of sand\n\n主2:	翻轉沙漏流逝 漩渦般思緒 穿針引線的流\n	像是個未經琢磨水晶 等待著誰挖掘著\n	視線漸漸扭曲 鏡面折射模糊的另外個我\n	但包覆在外是一層厚厚的沙模糊了我眼睛 \n	忽明忽滅\n\n副歌2:一次又一次 考驗著我 蛻變翱翔我破蛹為蛾\n\n	現在的我 緩緩爬出那兒 換我化身為殼\n	無懈可擊的 保護著那些愛我愛的人\n	不讓他們 受到任何傷痛 \n	我將阻擋著一切 這一切 \n	將希望寄託在他們的手', '', 390, '', '零', '大鳥', '零', 'Nausea 娜希雅樂團', '', 0, 1, 0, '2013-07-05 01:54:41', '2015-03-12 14:01:22', '0000-00-00 00:00:00'),
(65291, 136407, 5932, 1, 'I''ll Be Your Man (McFLY Cover)', '', '2013-07-05 00:00:00', 2000, 19, 2, 4, 'Been all around the world\n(在這個世界上)\nI never met a girl\n(我從來沒有遇過)\nWho does the things you do\n(像妳一樣的女孩)\nAnd puts me in the mood\n(讓我有這樣的感覺)\nTo love you and treat you right\n(去愛妳，好好對妳\nSo come here, and close your eyes\n(所以來吧，閉上眼睛)\nLie back, release your mind\n(躺下放鬆妳的思緒)\nAnd let the world fall down\n(讓世界崩塌)\nWhile I''m by your side\n(而我會在妳身旁)\n\nI''ll be your man through the fire\n(我會穿越火焰成為妳的男人)\nI''ll hold your hand through the flames\n(牽著妳的手走過烈焰)\nI''ll be the one you desire\n(我會成為妳渴望的那個人)\nHoney, cause I want you to understand\n(親愛的因為我要妳知道)\nI''ll be your man\n(我會成為妳的男人)\nI''ll be your man\n(我會成為妳的男人)\n\n\nI can lay with you for days\n(我可以天天躺在妳身邊陪妳)\nThe years can pass away\n(歲月可以流逝)\nThere''s lipstick on my face\n(妳的口紅印在我臉上)\nAnd I love the way you taste\n(而我喜歡這樣的妳)\nAnd I''m right here, so lock the door\n(我就在這，鎖上門吧)\nBecause you need me\n(因為妳需要我)\nBut I need you more\n(但我需要妳)\nAnd I don''t care, ''bout your mistakes\n(我不在乎妳做錯過甚麼)\nBecause they all went away\n(因為那早已過去了)\nWhen I found you Baby\n(當我遇到妳的時候)\n\nII''ll be your man through the fire\n(我會穿越火焰成為妳的男人)\nI''ll hold your hand through the flames\n(牽著妳的手走過烈焰)\nI''ll be the one you desire\n(我會成為妳渴望的那個人)\nHoney, cause I want you to understand\n(親愛的因為我要妳知道)\nI''ll be your man\n(我會成為妳的男人)\nI''ll be your man\n(我會成為妳的男人)', '', 301, '', 'McFly', 'McFly', '', '', '', 0, 1, 0, '2013-07-05 02:53:46', '2015-03-12 14:01:23', '0000-00-00 00:00:00'),
