(65320, 186252, 5933, 1, '獨白', '', '2013-07-05 00:00:00', 2013, 20, 0, 4, '我從來不知道  七色的彩虹  畫過天際會是如何的瑰麗\n我從來不知道  燦爛的星光  會如何點綴深夜裡的寧謐\n我從來不知道  母親的容顏  讓歲月刻出多少滄桑的痕跡\n我從來不知道  自己的容貌  在別人眼裡究竟是好還是糟\n\n看見對我來說一直都是虛無的字眼\n儘管某些時候會感覺到遺憾\n但失明仍然不會是我心中最大的悲傷\n\n我從來不知道  母親的容顏  讓歲月刻出多少滄桑的痕跡\n我從來不知道  自己的容貌  在別人眼裡究竟是好還是糟\n\n看見對我來說一直都是虛無的字眼\n儘管某些時候會感覺到遺憾\n但失明仍然不會是我心中最大的悲傷\n\n因為即使 走在街上忽然失去方向\n還會有很多陌生人會幫助我 給我溫暖\n讓我堅強 擁有愛人的力量 讓生命更加有光亮\n', '', 276, '', '', '', '', '可登音樂', '', 0, 1, 0, '2013-07-05 17:00:13', '2015-03-12 14:01:23', '0000-00-00 00:00:00'),
(65321, 186252, 5933, 2, '給阿嬤的祝福', '', '2013-07-05 00:00:00', 2013, 20, 0, 4, '阿嬤 我的阿嬤 毋知有偌久無來想起妳的形影\n媽媽每每若提起妳 點點的目屎總是拭袂乾\n\n阿嬤 我的阿嬤 記憶中的你一直無快活\n逐工透早出門拼血汗 為尪為囝受拖磨\n\n阿嬤 毋知妳這嘛敢有過著幸福的生活\n妳佇彼个世界無人行相偎  是毋是也感覺真孤單\n\n阿嬤 你毋通煩惱我  厝內的事項妳也毋免驚\n只要妳平安無所牽掛 阮攏佇遮祝福妳啦\n', '', 372, '', '', '', '', '可登音樂', '', 0, 1, 0, '2013-07-05 17:02:27', '2015-03-12 14:01:23', '0000-00-00 00:00:00'),
(65322, 186252, 5933, 3, '千言萬語', '', '2013-07-05 00:00:00', 2013, 20, 0, 4, '不知道為了什麼　憂愁他圍繞著我\n我每天都在祈禱　快趕走愛的寂寞\n  \n那天起　你對我說　永遠的愛著我\n千言和萬語　隨浮雲掠過\n  \n不知道為了什麼　憂愁他圍繞著我\n我每天都在祈禱　快趕走愛的寂寞\n', '', 244, '', '', '', '', '可登音樂', '', 0, 1, 0, '2013-07-05 17:04:35', '2015-03-12 14:01:23', '0000-00-00 00:00:00'),
