(65402, 186299, 0, 1, '七月天', '', '2013-07-01 00:00:00', 2000, 19, 1, 4, '七月天\n\n我想过爱过的沉默都已不在\n雨穿上蓝色衣已赶走了空白\n几片蔚蓝书页，写下永远\n我的心从此停靠，这瞬间\n\n那年海边的七月天，温柔消失前\n忽然间，没了时间\n孤单的七月天，回忆又浮现\n忽然间不见\n\n我想过爱过的什么都已不在\n我换上蓝色衣梦境依然空白\n一片蔚蓝天空，想到永远\n我的心停靠在，那瞬间\n\n那年海边的七月天，温柔消失前\n忽然间，没了时间\n孤单的七月天，回忆又浮现\n忽然间不见\n孤单的七月天，温柔消失前\n忽然间，没你的消息\n孤单的七月天，回忆又浮现\n忽然间不见\n', '', 256, '', '', '', '', '艾绮恩', '', 0, 1, 0, '2013-07-05 22:51:47', '2015-03-12 14:01:26', '0000-00-00 00:00:00'),
