(65417, 32959, 6258, 2, '我多麼想成為你的鹿', '', '2013-07-06 00:00:00', 2000, 25, 0, 7, '我多麼想成為你的鹿\n有寬容的眼神和厚厚的胸膛\n在這個被時間遺忘的地方\n共渡悠長的午後   或者一個夢\n\n當黑夜無聲墜入\n你的心變得荒蕪\n忘不掉總是那些最微小的事物\n\n我多麼想成為你的鹿\n用堅定的步伐穿越你的悲傷\n擔心迷路時我會在你身旁\n只要並肩走著   就不再孤單害怕\n\n當黑夜無聲墜入\n你的心變得荒蕪\n忘不掉總是那些最微小的事物\n當時間停下腳步\n你的世界起了霧\n願我勾起你的手輕聲地舞\n\n當黑夜無聲墜入\n你的心變得荒蕪\n忘不掉總是那些最微小的事物\n當時間停下腳步\n而回憶全是束縛\n讓我牽著你的手放聲地哭    直到日出\n', '', 308, '', '柯家洋', '柯家洋', '南瓜妮歌迷俱樂部', 'Maéjj', '', 0, 1, 0, '2013-07-06 00:13:46', '2015-03-12 14:01:27', '0000-00-00 00:00:00'),
(65418, 32959, 6258, 1, '果陀', '', '2013-07-06 00:00:00', 2000, 25, 0, 7, '我們都是無聲的魚   在城市張望\n穿越階梯廣場迴廊   交換著想像\n繞過黑暗的邊框   拼揍   自己的模樣\n清澈熾熱的眼光   卻包藏巨大的悲傷\n\n我們都是眼盲的獸   月光下遙望\n躍入這世界的姿態   曾美麗而喧譁\n而世界終究殘酷   或說是   青春殘酷\n在動與未動之間   我們先選擇了麻木\n\n我們所等待的   是文明或癲狂   是荒野或高牆   既現實又虛妄\n\n我們都是佇立的獸   盼暗中見光\n面對所有語義立場   都渴望更善良\n然而所有的困惑   都被   城市默許了\n現實迫使了結果   我們卻選擇了麻木\n\n我們所等待的   是文明或癲狂   是荒野或高牆   既現實又虛妄\n我們所耽溺的   是真理或信仰   是永恆或遺忘   越明晰越迷惘\n\n其實我們恐懼的   是心底慕求也許會實現\n越自制越混亂   越失去了形狀\n難道你還不了解   盼望著並不存在的樂園\n天光落下之後   沒有誰會出現\n', '', 396, '', '柯家洋', '柯家洋', '南瓜妮歌迷俱樂部', 'Maéjj', '', 0, 1, 0, '2013-07-06 00:23:21', '2015-03-12 14:01:27', '0000-00-00 00:00:00'),
