(65423, 165461, 5964, 1, '薑黃素~CuRCuMiN!!!', '', '2013-06-14 00:00:00', 2000, 10, 0, 8, '『薑黃素~CuRCuMiN!!!』\n曲: SPADE14 詞: Kuroro\n\nHEY U ,どこにいる？\n同じ青空を見上げられても\n希望がない、やり場を過ごして泣いて\n\nHEY U ,聴こえてるの？\n君のいる場所を見付けていてもね\n絶対痛みに壊されるその心はもう役立たず\n\n「クルクミンについては、特記なき場合データは常温二十五セルデグリー常圧百におけるものである、科学式の[C21H20O6]シー二十一エイチ二十オ六で材料の使用については恐らく安全てあると考えられている。」\n\nどんな痛み（が）あっても、なにもかも\n最後で少しだけで死亡の原因を清楚になってやる\n[クルクミンを] 心臓に使ったので、それなら\n最初で少しだけで死亡の味を甘くなってやるよ\n\n泣いて嗤う\n＿＿＿＿＿\n[中]\n\nHey u, 該死的你到底在哪裡？\n即使我們望著觀賞一樣的天空\n我已經不抱任何的希望，我一直都在哭，晃來晃去像失了魂一樣\n\nHey u, 該死的你有沒有聽到我?\n即使我該去哪裡找到你\n愛你的這個心臟已被痛苦殲滅而沒有用\n\n[關於薑黃素的用途，若非註明，所有數據均出自一般條件(25 ℃,100 kPa)下，其具體對人體有害的任何影響至今未確認。]\n\n傷口無論多麼多麼深，無論如何\n到死亡前的盡頭原因至少會更清楚一點\n心臟上若加[一點薑黃素]這樣的調味\n要來臨將我帶走的死亡至少會嚐起來甜一點\n＿＿＿＿＿\n[ENG]\n\nHey u! Where r u??\nEven if we''re watching the same sky\nAll that remains down here is despair, and i''m going nowhere, always crying\n\nHey u! Can u hear me modafuka??\nEven if i''d know where the fuck u are\nThis heart which has been fucked up by the pain is therefore useless\n\n[Concerning Curcumin''s properties, except where noted otherwise, data are given for materials in their standard state (at 25.C 100kPa] for the molecular formula C21H20O6, any hazardous effects have not been confirmed until now.]\n\nNo matter how much this hurts, no matter how,\nAt the very end, the cause of death will be a few more clarified\nAnd because i put it [the Curcumin] over my heart, Therefore\nat the very beginning, at least, the death will taste a little bit sweeter', '', 259, '', 'spade14', 'kuroro', 'spade14', 'spade14Official', '', 0, 1, 0, '2013-07-06 02:41:52', '2015-03-12 14:01:27', '0000-00-00 00:00:00'),
(65424, 165461, 5964, 2, '『リアル世界の付加価値とレム睡眠』  ', '', '2013-06-14 00:00:00', 2000, 10, 0, 8, '『リアル世界の付加価値とレム睡眠』\n曲: SPADE14 詞: Kuroro\n夜明けに聞こえてくる音響が嫌い\n夢からリアルに呼び戻されて嬉しくはない\nリアルなこの世界には関心が持ってない\nくちゃくちゃシーツで夢へ戻りたいが欲しい\n社会センスを絶対分かる人は俺じゃなきゃ\nレム睡眠の時だけ俺はすっきりできます〜★\n生活のすべての義務はきっとつまらない\nなぜ他の未来を切望しないのか？\nリアルなこの世界には興味がほとんどない\nくちゃくちゃシーツで夢へ戻りたいが欲しい\n社会センスを絶対分かる人は俺じゃなきゃ\nレム睡眠の時だけ俺はすっきりできます〜★\nあぁ、自分に残されたものは夢なのに\nそれならリアル世界にはなんの価値もない\n__________\n[中文]\n『真實世界附加價值和REM快速眼動睡眠階段』\n曲: SPADE14 詞: Kuroro\n醒了，清晨傳來的噪音都令我厭倦\n我從夢裡丟回現實，實在好不開心\n真實的世界真的使我感到無趣\n我只想回到我的被窩，回到我的夢裡\n我並不是非常解這社會應盡的義務\n只有進入快速動眼期才能讓我感到所有事都能迎刃而解\n生活上千篇一律的事物都讓我感到無聊\n對未來不期望任何其他的可能性嗎??\n真實的世界簡直使我感到無聊\n我只想回到我的被窩，回到我的夢裡\n我並不是非常解這社會應盡的義務\n只有進入快速動眼期才能讓我感到所有事都能迎刃而解\n哎呀，當自己所擁有的只剩下夢想\n對我來說真實世界已經沒有任何價值了\n__________\n[ENG]\nSong: SPADE14 Lyrics: Kuroro\n『the Real World Added Value & the REM Sleep Phase』\nJust woke up, and that bunch of noises, how i loathe them\nThrown out of my dreams into reality, this feels so uncomfortable\nI don''t give a fuck about this so-called real world\nAnd all i want is to get back into my sweet dreams\nCan''t really say i got any concern about society huh\nREM Phase is the only moment i can truly feel like i''m productive or something\nAll those those responsibilities about life and everything, this is so fucking boring man\nHey, ain''t u craving for any other perspective than this?\nI barely give a shit about the so-called real world\nAnd all i want is to get back into sweet dreams\nCan''t really say i got any concern about society huh\nREM Phase is the only moment i can truly feel like i''m productive or something\nAnyway, when all that remains to u is your dreams\nI guess Real World ain''t worth any Value anymore', '', 310, '', 'soade14', 'kuroro', 'spade14', 'spade14Official', '', 0, 1, 0, '2013-07-06 02:51:54', '2015-03-12 14:01:27', '0000-00-00 00:00:00'),
