(65429, 172975, 0, 1, '01.How many more generations-San Jiao Mao', '', '2013-06-01 00:00:00', 2000, 50, 0, 6, 'How Many More Generations?\n\nWhen the last forest is paved over\nand the mountains all run dry,\nthere won''t be time to form a committee\nto decide whether or not to die.\n\nI see polar ice caps melting.\nI see oil in the sea.\nThe web of life is growing threadbare\nwhile corporations are seeing green.\n\nThere is no life outside of nature.\nIt''s from her womb that we are born.\nAll our sky gods and our technology\ncan''t change the truth of where we''re from.\n\nSo how many more generations\nthat consume and don''t replace\nwill our mother Earth suffer\nbefore she wipes the slate clean?', '', 246, '', 'Red Rod', 'Red Rod', 'Keith Mi', 'San Jiao Mao', '', 0, 1, 0, '2013-07-06 15:25:38', '2015-03-12 14:01:27', '0000-00-00 00:00:00'),
(65430, 172975, 0, 1, '02.nobody''s listening -San Jiao Mao', '', '2013-06-01 00:00:00', 2000, 50, 0, 1, 'Nobody''s Listening\n\nOnce upon a time\nI was a prisoner of my fate,\npre-destined since the day I was made.\nI never knew if my election would come, \nso I said, "Fuck it all.\nI''m gonna raise some fun."\n\nHow high do you have to go,\nhow low do you have to fall,\nbefore you''ve exhausted all your chances?\nWhat do you have to say,\nto whom do you have to pray,\nwhen you know nobody''s listening?\n\nBurn no bridges;\ntake no prisoners;\ndo no harm.\nWe''re all free to rise up\nor to join the swarm.\nThe natural is super;\nthe super is a myth;\nand myths are made to be busted.\nI was born to rock''n''roll;\nIt was written in my soul;\noh, but I''m an agnostic.\n\nHow high do you have to go,\nhow low do you have to fall,\nbefore you''ve exhausted all your chances?\nWhat do you have to say,\nto whom do you have to pray,\nwhen you know nobody''s listening?\n\nWell there''s no more\ncity on a hill.\nProvidence is passe'';\nDestiny has fallen ill.\nUltimately alone\nwe wrestle with no fate.\nIt''s all in how you manifest\nthe chances you create.\n\nHow high do you have to go,\nhow low do you have to fall,\nbefore you''ve exhausted all your chances?\nWhat do you have to say,\nto whom do you have to pray,\nwhen you know nobody''s listening?', '', 261, '', 'Red Rod', 'Red Rod', 'Keith Mi', 'San Jiao Mao', '', 0, 1, 0, '2013-07-06 15:30:49', '2015-03-12 14:01:27', '0000-00-00 00:00:00'),
(65431, 172975, 0, 1, '03.second chance-San Jiao Mao', '', '2013-06-01 00:00:00', 2000, 50, 0, 1, 'Second Chance\n\nAin''t life strange?\nIt finds you when you don''t expect it to.\nAin''t it funny how\nyou never know when signigicance is happening?\nA random glance,\na stray smile leads to re-awakening,\nre-born on ashes of before.\n\nAnd I swear I''ll make the most\nof my second chance with you.\nI swear I''ll make the most\nof my second chance.\n\nAin''t life grand?\nYou forget when you''re wallowing\nthrough the mundane of day to day.\nAin''t it funny how\nwe''re all swallowed up in routine?\nTake a chance\nand recognize what you''ve been missing.\n\nAnd I swear I''ll make the most\nof my second chance with you.\nI swear I''ll make the most\nof my second chance.\n\nIt''s so hard to believe\nwhen something good is happening.\nYou''ve been burnt before\nso you think that it''s not right.\nSit back, sit back\nand just let things happen.\nThis time, I swear it''s right.\n\nAin''t life wonderful\nand tragical\nand comical?\nIt''s a riddle\nthat can''t be solved.\nTake a chance\nand realize possibility.\nYou can always get back up again.\n\nAnd I swear I''ll make the most\nof my second chance with you.\nI swear I''ll make the most\nof my second chance.\n\n', '', 400, '', 'Red Rod', 'Red Rod ', 'Keith Mi', 'San Jiao Mao', '', 0, 1, 0, '2013-07-06 15:31:38', '2015-03-12 14:01:27', '0000-00-00 00:00:00'),
(65432, 172975, 0, 1, '04.striving toward the sunlight-San Jiao Mao', '', '2013-06-01 00:00:00', 2000, 50, 0, 6, 'Striving Towards Sunlight\n\n   by Robert W. Smith\n\nMy life has been\n   a bitter mess,\nBut I never stopped\n           dreaming,\nTrying to grow\ninto a whole,\nstriving towards sunlight.\n\n   My days are shorter\nand my nights are long\nBut still,\nstriving towards sunlight,\nI never cease\n     to go on\n     going on\n     going on.\n\nThe music runs through me;\nI reach down to take a breath,\nCatch wisps of song\nthat leave my mouth.\n\nThere''s nothing bitter about\n     the sweet notes I savor\n                    and love.\nAnd sunlight surrounds\n    and nights go away,\n    As I go on\n      going on\n      going on.\nLet the music play.\n\nThere''s nothing bitter about\n     the sweet notes I savor\n                    and love\n                    and love.\n          Let the music play.', '', 202, '', 'Red Rod', 'Red Rod', 'Keith Mi', 'San Jiao Mao', '', 0, 1, 0, '2013-07-06 15:32:42', '2015-03-12 14:01:27', '0000-00-00 00:00:00'),
